import React, { Component, useState } from "react";
import Sticky from "Components/Sticky/index";
import Dropdown from "Components/Dropdown";
import { ReactComponent as Back } from 'Icons/back.svg'
import Checkbox from "Components/Checkbox/index";
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';
import { AiOutlineCloseCircle, AiOutlinePlusCircle } from "react-icons/ai";
import { IoIosArrowDropdown, IoIosArrowDropup } from "react-icons/io";
import Input from "Components/FormInput/index";


class CreateNewContracts extends Component {
  constructor(props) {
    super(props);

    this.state = {
      selectedArray: [],
      allSelected: true,
      values: [
        {
          rake: "Rake",
          ommodityCategory: "Commodity Category",
          commodityName: "Commodity Name",
          typeWagon: "Type of Wagon",
          numberWagonn: "No. of Wagon",
          weightWagon: "Wagon Wt."
        }
      ],
      isCheckAll: "false",
      checkedBlue: false,
      transporter: [
        { id: 1, value: "Transporter 1", isChecked: false },
        { id: 2, value: "Transporter 2", isChecked: false },
        { id: 3, value: "Transporter 3", isChecked: false },
      ],
      allData1: [
        { id: 44, name: "Transporter", check1: "Transporter 1" },
        { id: 45, name: "Transporter", check1: "Transporter 1" },
        { id: 46, name: "Transporter", check1: "Transporter 1" },
        { id: 47, name: "Transporter", check1: "Transporter 1" }
      ],
      allData2: [
        { id: 44, name: "Transporter", check2: "Transporter 2" },
        { id: 45, name: "Transporter", check2: "Transporter 2" },
        { id: 46, name: "Transporter", check2: "Transporter 2" },
        { id: 47, name: "Transporter", check2: "Transporter 2" }
      ],
      allData3: [
        { id: 44, name: "Transporter", check3: "Transporter 3" },
        { id: 45, name: "Transporter", check3: "Transporter 3" },
        { id: 46, name: "Transporter", check3: "Transporter 3" },
        { id: 47, name: "Transporter", check3: "Transporter 3" }
      ]
    };
  }

  handleChange(i, e) {
    let Values = this.state.values;
    Values[i][e.target.name] = e.target.value;
    this.setState({ values });
  }


  addFields() {
    this.setState(({
      values: [...this.state.values, {
        rake: "Rake",
        commodityCategory: "Commodity Category",
        commodityName: "Commodity Name",
        typeWagon: "Type of Wagon",
        numberWagonn: "No. of Wagon",
        weightWagon: "Wagon Wt."
      }]
    }))
  }

  unCheck(i) {
    let ref = 'ref_' + i;
    this.refs[ref].checked = !this.refs[ref].checked;
  }

  removeFields(i) {
    console.log(i);
    let Values = this.state.values;
    Values.splice(i, 1);
    this.setState({ Values });
  }

  checkedFullRow = (id) => {
    console.log(id);
    const { selectedArray } = this.state;
    if (selectedArray.includes(id)) {
      let schIndex = selectedArray.indexOf(id)
      selectedArray.splice(schIndex, 1)
      this.setState({ selectedArray: selectedArray })
    } else {
      this.setState({ selectedArray: [...selectedArray, id] })
    }
  }

  selectAllScheduleRecords = () => {
    const { allData1 } = this.state;
    const { selectedArray } = this.state
    let selectedSchedulesCopy = [...selectedArray]
    const value = (selectedSchedulesCopy.length !== allData.length);

    if (value) {
      (allData1 || []).map((obj) => {
        if (!selectedSchedulesCopy.find(a => a === obj.id)) {
          selectedSchedulesCopy.push(obj.id);
        }
      })
    }
    else {
      selectedSchedulesCopy = [];
    }
    this.setState({ selectedArray: selectedSchedulesCopy });
  }


  render() {

    console.log(this.state.selectedArray);

    var Handlechange = e => {
      this.setState({ show: !this.state.show });
    }

    var alterHandleChange = e => {
      this.setState({ alterShow: !this.state.alterShow });
    }


    var toggleChecked = e => {
      this.state.checked((prevState) => {
        let newState = { ...prevState }
        newState[e] = !prevState[e];
        return newState;
      });
    };

    // var selectAll = value => {
    //   this.state.checked(value);
    //   this.state
    // }

    const handleChecked = () => {
      this.state.checkedBlue == true;
    }



    const contentStyle = {
      width: "auto",
      height: "auto",
      maxHeight: "80%",
      overflowY: "scroll"
    }






    const temp = [{ id: 1, name: "Option1" }, { id: 2, name: "Option2" }, { id: 3, name: "Option3" }];


    return (

      <Sticky>
        <div className="main-div" style={{ maxWidth: "2000px" }}>


          <div className="arrow-text" style={{ cursor: "pointer" }}>
            <div onClick={() => {
              this.props.history.push('/viewGeneratedContracts')
            }}>
              <Back className="fill-theme mr-5" />
            </div>
            <div className="header-text">
              Create New Contract
            </div>
          </div>

          <div className="back-light-blue">

            <div className="input-fields">
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  Route Code
                </div>
                <Dropdown
                  items={temp}
                  label="Route Code"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  From
                </div>
                <Dropdown
                  items={temp}
                  label="From"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  To
                </div>
                <Dropdown
                  items={temp}
                  label="To"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  Origin Yard
                </div>
                <Dropdown
                  items={temp}
                  label="Origin Yard"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  Destination Yard
                </div>
                <Dropdown
                  items={temp}
                  label="Destination Yard"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              {/* <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px" }}>.</div>
                <div className="search-button">
                  Search
                </div>
              </div> */}
              <button
                className={"bg-theme wt-250 pl-15 pr-15 mr-5 ht-40 br-5 fBold fs-14 white-color ml-15 mt-20 bg-blue"}
              >Search</button>
            </div>

            {this.state.values.map((element, index) => (
              <div className="input-fields" key={index}>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.rake}
                  </div>
                  <Dropdown
                    items={temp}
                    label=" Full Rake"
                    displayKey="name"
                    selectedItem={null}
                    onSelect={this.selectBranchId}
                    className="mb-0 wt-250 ht-30"
                    searchEnabled={true}
                  />
                </div>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.commodityCategory}
                  </div>
                  <Dropdown
                    items={temp}
                    label="Commodity Category"
                    displayKey="name"
                    selectedItem={null}
                    onSelect={this.selectBranchId}
                    className="mb-0 wt-250 ht-30 wd-500"
                    searchEnabled={true}
                  />
                </div>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.commodityName}
                  </div>
                  <Dropdown
                    items={temp}
                    label="Commdity Name"
                    displayKey="name"
                    selectedItem={null}
                    onSelect={this.selectBranchId}
                    className="mb-0 wt-250 ht-30 wd-500"
                    searchEnabled={true}
                  />
                </div>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.typeWagon}
                  </div>
                  <Dropdown
                    items={temp}
                    label="BCN"
                    displayKey="name"
                    selectedItem={null}
                    onSelect={this.selectBranchId}
                    className="mb-0 wt-250 ht-30 wd-100"
                    searchEnabled={true}
                  />
                </div>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.numberWagonn}
                  </div>
                  <Input
                    label="55"
                    displayKey="name"
                    selectedItem={null}
                    className="mb-0 wt-250 ht-30 wd-100"
                    style={{ width: "120px", height: "36px", background: "white", borderRadius: "5px" }}
                  />
                </div>
                <div className="fs-14 header-dark-color mr-10">
                  <div style={{ paddingBottom: "5px", color: "white" }}>
                    {element.weightWagon}
                  </div>
                  <Input
                    label="55"
                    displayKey="name"
                    selectedItem={null}
                    className="mb-0 wt-250 ht-30 wd-100"
                    style={{ width: "120px", height: "36px", background: "white", borderRadius: "5px" }}
                  />
                </div>
                {
                  index ?
                    <div className="fs-14 header-dark-color mr-10 cursor-pointer">
